(1, 'CÓ SỐ DƯ RỒI LÀM SAO ĐỂ RÚT VỀ???', 'co-so-du-roi-lam-sao-de-rut-ve', 'https://i.pinimg.com/originals/81/a2/47/81a2476aa0c173840b29f07a798f15e1.jpg', '<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\">- Bạn cần điền ch&iacute;nh x&aacute;c th&ocirc;ng tin t&agrave;i khoản ng&acirc;n h&agrave;ng ở mục t&agrave;i khoản</p>\r\n<p dir=\"ltr\">- Nếu số dư từ 10K th&igrave; đến c&aacute;c ng&agrave;y định k&igrave; sẽ tự động chuyển hết tiền về thẻ ng&acirc;n h&agrave;ng của bạn</p>\r\n<p dir=\"ltr\">- Nếu số dư dưới 10K th&igrave; cứ mua h&agrave;ng th&ecirc;m bao giờ số dư từ 10K th&igrave; sẽ được chuyển tiền&nbsp;</p>\r\n<p>_______________________________________<br>Nếu vẫn c&ograve;n thắc mắc vui l&ograve;ng li&ecirc;n hệ qua mục fb ph&iacute;a b&ecirc;n g&oacute;c của website:&nbsp;<strong><a href=\"../../../\">thanhsansale.com</a>&nbsp;để được hỗ trợ</strong></p>', '2023-08-21 15:15:28', 'System', '2024-06-24 12:32:07', 'Admin', 1),
(3, 'HƯỚNG DẪN CÁC BƯỚC MUA HÀNG HOÀN TIỀN', 'huong-dan-cac-buoc-mua-hang-hoan-tien', 'https://i.pinimg.com/originals/c1/71/9d/c1719dc04eefe81cde3ac0a5505eb037.png', '<p>&nbsp;</p>\r\n<p><strong>Bước 1: V&agrave;o tr&igrave;nh duyệt(Google, Safari, Cốc Cốc,...) g&otilde; v&agrave; truy cập v&agrave;o Website: <a href=\"../../../\">thanhsansale.com</a>&nbsp;</strong></p>\r\n<p><strong>Bước 2: Bấm mục \"Đăng nhập\" để đăng nhập hoặc đăng k&iacute; t&agrave;i khoản</strong><br>&nbsp;+ Nếu chưa c&oacute; t&agrave;i khoản, th&igrave; bấm v&agrave;o mục \"Tạo\" sau đ&oacute; điền th&ocirc;ng tin username, gmail, mật khẩu<br>&nbsp;+ Khi đăng k&iacute; sẽ c&oacute; OTP gửi về gmail, nhớ nhập OTP x&aacute;c thực để k&iacute;ch hoạt t&agrave;i khoản<br>&nbsp;+ Nếu kh&ocirc;ng nhớ username th&igrave; c&oacute; thể nhập gmail thay username để đăng nhập.&nbsp;</p>\r\n<p><strong>Bước 3: Sao ch&eacute;p link sản phẩm cần mua từ s&agrave;n Shopee hoặc Lazada, d&aacute;n link sản phẩm đ&oacute; v&agrave;o &ocirc; \"D&aacute;n link sản phẩm\" tại website, bấm &ldquo;T&igrave;m kiếm&rdquo;&nbsp;</strong></p>\r\n<p><strong>Bước 4: Bấm \"Mua Ngay\" để mở qua app Shopee(Lazada) mua lu&ocirc;n tại thiết bị điện thoại bạn đang d&ugrave;ng.&nbsp; <br></strong>&nbsp;+ \"Chia sẽ link\" để gửi link cho bạn b&egrave; mua theo đường link đ&oacute;(nếu bạn b&egrave; nhấn đặt h&agrave;ng theo link th&igrave; đơn h&agrave;ng đ&oacute; sẽ ghi nhận cho t&agrave;i khoản của bạn)<br><br><span style=\"background-color: #f1c40f;\"><strong>*QUAN TRỌNG:</strong> </span>Sau khi thực hiện Bước 4 xong th&igrave; kh&ocirc;ng click mở th&ecirc;m link n&agrave;o kh&aacute;c v&agrave; đặt h&agrave;ng lu&ocirc;n<br>=&gt; Nếu sau khi thực hiện bước 4 m&agrave; mở link kh&aacute;c rồi mới đặt h&agrave;ng, th&igrave; đơn h&agrave;ng đ&oacute; sẽ kh&ocirc;ng được ghi nhận ho&agrave;n tiền<br>=&gt; Nếu lỡ ấn v&agrave;o mở link kh&aacute;c th&igrave; thực hiện lại bước 4 sau đ&oacute; đặt h&agrave;ng(c&aacute;c link m&atilde; giảm gi&aacute; trong nh&oacute;m cũng t&iacute;nh l&agrave; link kh&aacute;c)</p>\r\n<p>_______________________________________</p>\r\n<p>Tham khảo th&ecirc;m 1 số lưu &yacute; khi ho&agrave;n tiền Shopee tại:&nbsp;<a href=\"../../../danh-muc/shoppe-1\">https://thanhsansale.com/danh-muc/shoppe-1</a></p>\r\n<p>Tham khảo th&ecirc;m 1 số lưu &yacute; khi ho&agrave;n tiền Lazada tại: <a href=\"../../../danh-muc/lazada-2\">https://thanhsansale.com/danh-muc/lazada-2</a></p>\r\n<p>_______________________________________</p>\r\n<p><span style=\"background-color: #f1c40f;\"><strong>VIDEO M&Igrave;NH HỌA CHI TIẾT C&Aacute;C BƯỚC MUA H&Agrave;NG HO&Agrave;N TIỀN: <a class=\"ytp-share-panel-link ytp-no-contextmenu\" href=\"https://youtu.be/fjrCekKdEyI\" target=\"_blank\" rel=\"noopener\" aria-label=\"Chỉa sẻ li&ecirc;n k&ecirc;́t\">https://youtu.be/fjrCekKdEyI</a></strong></span></p>\r\n<p>_______________________________________<br>Nếu vẫn c&ograve;n thắc mắc vui l&ograve;ng li&ecirc;n hệ qua mục fb ph&iacute;a b&ecirc;n g&oacute;c của website:&nbsp;<strong><a href=\"../../../\">thanhsansale.com</a>&nbsp;</strong>để được hỗ trợ</p>', '2024-05-18 21:43:06', 'Admin', '2024-07-03 14:59:48', 'Admin', 1),
(4, 'NGUYÊN NHÂN ĐƠN HÀNG LAZADA BỊ HOÀN TIỀN 0Đ, HỦY ĐƠN', 'nguyen-nhan-don-hang-lazada-bi-hoan-tien-0d-huy-don', 'https://i.pinimg.com/originals/16/8d/f5/168df5da0a22e1c8fb8b99e3a301a15b.jpg', '<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>1. NGUY&Ecirc;N NH&Acirc;N ĐƠN H&Agrave;NG LAZADA BỊ HO&Agrave;N TIỀN 0Đ:&nbsp;</strong></p>\r\n<p dir=\"ltr\"><strong>+ Do mua sản phẩm từ choice, livestream, like v&agrave; c&aacute;c sản phẩm do nh&agrave; b&aacute;n h&agrave;ng tự vận chuyển</strong></p>\r\n<p dir=\"ltr\"><strong>+ Do sản phẩm kh&ocirc;ng c&oacute; hoa hồng gốc, hoặc do việc tắt/bật hoa hồng thưởng:</strong></p>\r\n<p>&nbsp; - Hoa hồng c&oacute; 2 loại ch&iacute;nh: hoa hồng cơ bản(gốc) được trả từ Lazada v&agrave; hoa hồng thưởng được trả từ gian h&agrave;ng.&nbsp; &nbsp;</p>\r\n<p>&nbsp; - Việc bật/tắt hoa hồng thưởng kh&ocirc;ng thể cập nhật th&ocirc;ng tin ch&iacute;nh x&aacute;c theo thời gian thực được. Thường th&ocirc;ng tin ch&iacute;nh x&aacute;c sẽ được cập nhật sau 1-2 ng&agrave;y(Lazada cập nhật).</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp; - Dẫn đến việc hoa hồng được b&aacute;o sẽ kh&ocirc;ng ch&iacute;nh x&aacute;c 100% v&igrave; một số gian h&agrave;ng thường xuy&ecirc;n thay đổi trạng th&aacute;i bật tắt hoa hồng thưởng.</p>\r\n<p dir=\"ltr\" role=\"presentation\">&nbsp; - Dưới đ&acirc;y l&agrave; danh s&aacute;ch ng&agrave;nh h&agrave;ng v&agrave; gian h&agrave;ng kh&ocirc;ng c&oacute; hoa hồng cơ bản (gốc):&nbsp;</p>\r\n<p dir=\"ltr\" role=\"presentation\"><strong><img src=\"https://i.pinimg.com/736x/bc/76/03/bc76034058357c3827e1c9b4388db586.jpg\" alt=\"H&igrave;nh ảnh Ghim c&acirc;u chuyện\" width=\"593\" height=\"633\"></strong></p>\r\n<p>.</p>\r\n<p><strong>2. NGUY&Ecirc;N NH&Acirc;N ĐƠN H&Agrave;NG LAZADA BỊ B&Aacute;O TRẠNG TH&Aacute;I TH&Agrave;NH \"HỦY\" ĐƠN HOẶC KH&Ocirc;NG ĐƯỢC GHI NHẬN:</strong></p>\r\n<p>&nbsp; - Sử dụng nhiều t&agrave;i khoản tr&ecirc;n c&ugrave;ng một thiết bị hoặc một địa chỉ mạng hoặc một địa chỉ nhận h&agrave;ng.</p>\r\n<p>&nbsp; - Sử dụng nhiều thiết bị, t&agrave;i khoản để đặt chung 1 số sản phẩm v&agrave; &aacute;p chung 1 số m&atilde; nhất định giống nhau.</p>\r\n<p>&nbsp; - Lạm dụng qu&aacute; nhiều m&atilde; giảm gi&aacute;, code cho 1 đơn h&agrave;ng.</p>\r\n<p>&nbsp; - Thời gian ở lại app Lazada qu&aacute; ngắn. Tốt nhất n&ecirc;n từ 1 ph&uacute;t sau kể từ sau khi click v&agrave;o link mở sản phẩm từ web.</p>\r\n<p>&nbsp; - Click li&ecirc;n tục, chồng ch&eacute;o qu&aacute; nhiều link v&agrave;o app Lazada.</p>\r\n<p>&nbsp; - Đặt h&agrave;ng dồn dập nhiều đơn li&ecirc;n tục. N&ecirc;n chia rải đơn ra để đặt.</p>\r\n<p>&nbsp; - Ch&uacute; &yacute;: Việc qu&eacute;t hủy đơn thuộc to&agrave;n quyền quyết định từ Lazada. Web ho&agrave;n tiền chỉ đối chiếu dữ liệu từ Lazada trả về b&aacute;o lại h&agrave;ng ng&agrave;y th&ocirc;i</p>\r\n<p>_______________________________________<br>Nếu vẫn c&ograve;n thắc mắc vui l&ograve;ng li&ecirc;n hệ qua mục fb ph&iacute;a b&ecirc;n g&oacute;c của website:&nbsp;<strong><a href=\"../../../\">thanhsansale.com</a>&nbsp;</strong>để được hỗ trợ</p>', '2024-05-21 18:10:30', 'Admin', '2024-06-24 12:31:49', 'Admin', 1),
(5, 'SHOPEE VIDEO', 'shopee-video', 'https://i.pinimg.com/originals/0a/2b/e8/0a2be842ba79a6f9e8cab656eda57dbc.jpg', '<p dir=\"ltr\">&nbsp;</p>\r\n<p dir=\"ltr\"><strong>HƯỚNG DẪN CHI TIẾT C&Aacute;C BƯỚC MUA H&Agrave;NG SHOPEE VIDEO ĐƯỢC HO&Agrave;N TIỀN:&nbsp;</strong></p>\r\n<p dir=\"ltr\">Bước 1: Nếu sản phẩm cần mua c&oacute; tag live/video th&igrave; đặt 1 đơn, sau đ&oacute; hủy đơn lu&ocirc;n(kh&ocirc;ng c&oacute; th&igrave; bỏ qua bước n&agrave;y)</p>\r\n<p dir=\"ltr\">Bước 2: Th&ecirc;m sản phẩm cần mua từ video CỦA SHOP Đ&Oacute; v&agrave;o giỏ h&agrave;ng(mua của shop n&agrave;o th&igrave; phải v&agrave;o đ&uacute;ng video của ch&iacute;nh shop đ&oacute; để lấy sản phẩm)</p>\r\n<p dir=\"ltr\">Bước 3: Sao ch&eacute;p link sản phẩm v&agrave; d&aacute;n l&ecirc;n web ho&agrave;n tiền =&gt; chọn &ldquo;T&igrave;m kiếm&rdquo;</p>\r\n<p dir=\"ltr\">Bước 4: Chọn &ldquo;Mua ngay&rdquo; hoặc &ldquo;Chia Sẻ Link&rdquo; để mở app shopee dẫn đến sản phẩm</p>\r\n<p dir=\"ltr\">Bước 5: Th&ecirc;m sản phẩm đ&oacute; v&agrave;o giỏ h&agrave;ng của bạn v&agrave; v&agrave;o giỏ h&agrave;ng giảm số lượng về lại 1 hoặc như về như &yacute; muốn</p>\r\n<p dir=\"ltr\">Bước 6: Đặt h&agrave;ng v&agrave; &aacute;p m&atilde; video như b&igrave;nh thường</p>\r\n<p dir=\"ltr\"><em><strong>VIDEO HƯỚNG DẪN CHI TIẾT: <a href=\"https://youtu.be/55Jb3v1qKHU\">https://youtu.be/55Jb3v1qKHU</a>&nbsp;</strong></em></p>\r\n<p dir=\"ltr\"><br>ẢNH MINH HỌA C&Aacute;CH V&Agrave;O TRANG VIDEO CỦA SHOP B&Aacute;N:</p>\r\n<p dir=\"ltr\"><img src=\"https://i.pinimg.com/originals/d7/ff/8b/d7ff8b877612519247dadb9285ca179b.jpg\" width=\"599\" height=\"337\"></p>\r\n<p dir=\"ltr\">Một số shop chưa đăng video hoặc kh&ocirc;ng đăng video c&oacute; gắn sản phẩm bạn cần mua. Th&igrave; cứ nhắn trực tiếp nhờ shop đ&oacute; l&ecirc;n video gắn sản phẩm. Mua shop n&agrave;o th&igrave; nhắn nhờ đ&uacute;ng shop đ&oacute; nh&eacute;!</p>\r\n<p dir=\"ltr\">_______________________________________</p>\r\n<p dir=\"ltr\">Xem th&ecirc;m hướng dẫn c&aacute;ch sử dụng web ho&agrave;n tiền tại: <a href=\"../../../blog/huong-dan-cac-buoc-mua-hang-hoan-tien-3\">https://thanhsansale.com/blog/huong-dan-cac-buoc-mua-hang-hoan-tien-3</a>&nbsp;</p>\r\n<p dir=\"ltr\">_______________________________________<br>Nếu vẫn c&ograve;n thắc mắc vui l&ograve;ng li&ecirc;n hệ qua mục fb ph&iacute;a b&ecirc;n g&oacute;c của website:&nbsp;<strong><a href=\"../../\">thanhsansale.com</a>&nbsp;</strong>để được hỗ trợ</p>', '2024-06-22 19:05:21', 'Admin', '2024-07-02 09:22:48', 'Admin', 1);
