3hjcUNPdlWQSlG5scGqL7TYwVebRubL9theDJsS4oZkaBsKZnuh403wj8jnC1uf+fSKOwNXH1OG6GBURX55B2nmUrMStQ2LGLElUeRh1bAKT2BqDvQGN1aoWW+KOTxGq7AwzgkXIFrEEGXRxZUP7NKFneGF9iosVbNhSJ0vpOHPKpNp9MYmv8iQafmBV49ScX8RwjqnQA==; SPC_U=707623395; SPC_T_IV=M1BDMkxWZzFMTnp6UjhVYw==; SPC_R_T_ID=rY8yMoY4C8bLXImOc//m55j4aGkD0t/UMSXNKJO2Ob17erI+k6LFyyHh1JjdKHHH1yGNHLxjgugMrdFiEvGBx8tXdVodx62IVdlniT5ODJX6fUOlvkDIy+2Cj61+iY/8mEIXqiCcKclVnBYS72a72LJDvLyZrHX5ev6jcHJ2b6I=; SPC_R_T_IV=M1BDMkxWZzFMTnp6UjhVYw==; SPC_T_ID=rY8yMoY4C8bLXImOc//m55j4aGkD0t/UMSXNKJO2Ob17erI+k6LFyyHh1JjdKHHH1yGNHLxjgugMrdFiEvGBx8tXdVodx62IVdlniT5ODJX6fUOlvkDIy+2Cj61+iY/8mEIXqiCcKclVnBYS72a72LJDvLyZrHX5ev6jcHJ2b6I=; _ga_4GPP1ZXG63=GS1.1.1720259668.523.1.1720261075.47.0.0; _dc_gtm_UA-61914164-6=1; _ga=GA1.2.1239285516.1714727076; _gali=offer%24Menu', 0.51, '<div class=\"card-header\">\r\n<div class=\"card-header\">\r\n<h3 class=\"card-title\"><span style=\"background-color: #2dc26b;\">GIẢI Đ&Aacute;P THẮC MẮC THƯỜNG GẶP KHI HO&Agrave;N TIỀN SHOPEE:<br></span></h3>\r\n</div>\r\n<div class=\"card-body\">\r\n<div class=\"row question\">\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>1. Mua h&agrave;ng qua Shopee Video(c&oacute; tag Video) c&oacute; được ho&agrave;n tiền kh&ocirc;ng?</strong></span></p>\r\n<p dir=\"ltr\">C&oacute; được ho&agrave;n tiền. Tuy nhi&ecirc;n phải thực hiện đ&uacute;ng theo hướng dẫn tại: <a href=\"../../../trang/huong-dan-mua-hang-shopee-video-duoc-hoan-tien-4\">https://thanhsansale.com/trang/huong-dan-mua-hang-shopee-video-duoc-hoan-tien-4</a>&nbsp;</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>2. Mua h&agrave;ng qua Shopee Live(c&oacute; tag Live) c&oacute; được ho&agrave;n tiền kh&ocirc;ng?</strong></span></p>\r\n<p dir=\"ltr\">Kh&ocirc;ng được ho&agrave;n tiền. Nếu c&oacute; gắn tag Live th&igrave; đặt 1 đơn của sản phẩm cần mua rồi hủy đơn ngay, sau đ&oacute; d&aacute;n link v&agrave;o web, bấm mua ngay rồi đặt h&agrave;ng để được ghi nhận ho&agrave;n tiền</p>\r\n<p dir=\"ltr\">Tỷ lệ mất đơn khi bạn c&oacute; lịch sử từng gắn tag live/click giỏ live/đặt đơn live trong v&ograve;ng 7 ng&agrave;y gần nhất l&ecirc;n đến 50%</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>3. Muốn mua gộp nhiều sản phẩm v&agrave;o c&ugrave;ng 1 đơn h&agrave;ng phải l&agrave;m thế n&agrave;o?</strong></span></p>\r\n<p dir=\"ltr\">Mua nhiều sản phẩm C&ugrave;ng Một Shop, chỉ cần d&aacute;n một link v&agrave;o web v&agrave; bấm mua ngay sau đ&oacute;. C&aacute;c sản phẩm kh&aacute;c của shop đ&oacute; đều được &aacute;p dụng ho&agrave;n tiền.</p>\r\n<p dir=\"ltr\">Nếu mua ở Nhiều Shop Kh&aacute;c Nhau, bắt buộc phải t&aacute;ch đặt ri&ecirc;ng mỗi shop th&agrave;nh một đơn h&agrave;ng ri&ecirc;ng biệt để đặt h&agrave;ng.</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>4. Tại sao số tiền nhận được khi đặt đơn lại &iacute;t hơn so với số ho&agrave;n tiền tối đa m&agrave; web hiển thị?</strong></span></p>\r\n<p dir=\"ltr\">Ho&agrave;n tiền sẽ t&iacute;nh theo % nh&acirc;n(x) tiền sản phẩm. N&ecirc;n khi &aacute;p k&egrave;m m&atilde; th&igrave; sẽ l&agrave; nh&acirc;n(x) với số tiền sản phẩm SAU KHI &Aacute;P M&Atilde; v&agrave; XU.</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>5. Tại sao đặt đơn theo c&aacute;c bước hướng dẫn rồi m&agrave; kh&ocirc;ng được ghi nhận đơn hoặc bị hủy đơn trong khi đơn h&agrave;ng vẫn đang giao b&igrave;nh thường?</strong></span></p>\r\n<p dir=\"ltr\">Sản phẩm c&oacute; gắn tag Shopee Live. Ngo&agrave;i ra 1% nhỏ l&agrave; kh&ocirc;ng ghi nhận được ID đơn h&agrave;ng dẫn đến đơn h&agrave;ng bị &ldquo;thất lạc&rdquo; tr&ecirc;n hệ thống.</p>\r\n<p dir=\"ltr\">Thời gian đặt h&agrave;ng kể từ khi mở theo link ho&agrave;n tiền qu&aacute; nhanh. Thường th&igrave; mở xong mua liền trong 1p vẫn được ghi nhận nhưng sẽ c&oacute; tỷ lệ bị rớt đơn. N&ecirc;n mở link xong sau 2-3p rồi mua!</p>\r\n<p dir=\"ltr\">Việc qu&eacute;t hủy đơn thuộc to&agrave;n quyền quyết định từ Shopee. Web ho&agrave;n tiền chỉ đối chiếu dữ liệu từ Shopee trả về b&aacute;o lại h&agrave;ng ng&agrave;y th&ocirc;i.</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>6. Tại sao vừa đặt h&agrave;ng th&agrave;nh c&ocirc;ng rồi m&agrave; v&agrave;o mục Đơn h&agrave;ng kiểm tra lại kh&ocirc;ng hiện đơn?</strong></span></p>\r\n<p dir=\"ltr\">Đơn h&agrave;ng đặt th&agrave;nh c&ocirc;ng, trạng th&aacute;i của c&aacute;c đơn h&agrave;ng sẽ được cập nhật v&agrave;o trước 20H của ng&agrave;y h&ocirc;m sau.</p>\r\n<p dir=\"ltr\"><span style=\"background-color: #fbeeb8;\"><strong>7. Tại sao mua số lượng từ x2 lại chỉ nhận được tiền ho&agrave;n l&agrave; 25.500Đ?</strong></span></p>\r\n<p dir=\"ltr\">Shopee c&oacute; giới hạn tiền ho&agrave;n cho 1 số sản phẩm. N&ecirc;n số tiền web b&aacute;o l&agrave; ch&iacute;nh x&aacute;c khi bạn mua số lượng x1. Nếu mua từ x2 hoặc mua gộp chung nhiều sản phẩm của shop bị giới hạn. Th&igrave; số tiền nhận được sẽ l&agrave; 25.500Đ.&nbsp;</p>\r\n<p dir=\"ltr\">_______________________________________<br>Nếu vẫn c&ograve;n thắc mắc vui l&ograve;ng li&ecirc;n hệ qua mục fb ph&iacute;a b&ecirc;n g&oacute;c của website:&nbsp;<strong><a href=\"../../../\">thanhsansale.com</a>&nbsp;</strong>để được hỗ trợ<strong><br><br></strong>Thời gian cập nhật gần nhất: 9H00 ng&agrave;y 01/07/2024<strong><br></strong></p>\r\n<strong id=\"docs-internal-guid-fd4df87d-7fff-e35e-c2c5-df5834f457be\"></strong></div>\r\n</div>\r\n</div>', '2023-08-21 15:15:28', 'System', '2024-07-06 17:19:14', 'Admin', 1),
